INSERT INTO `article` (`id`, `url_key`, `author_id`, `category_id`, `created_at`, `updated_at`, `is_published`, `intro_text`, `full_text`, `title`, `meta_keywords`, `meta_description`) VALUES
(1, 'order-project', 1, 1, '2015-01-18 13:36:29', '2015-04-09 08:30:47', 1, '', 'Любой <b>типовой проект</b>, независимо от места его разработки, при реализации должен быть привязан к конкретной территории. Адаптация проводится согласно расположению плана земли и имеющимся там грунтам.\r\n<br/><br/>\r\nЕсли присутствуют сомнения относительно правильного выбора типового проекта под свой земельный участок, то важно услышать компетентную консультацию специалистов нашей компании. Но для этого необходимы официальные документы: топографическая съемка и копия земельно-кадастрового плана участка.\r\n<br/><br/>\r\nНаши сотрудники бесплатно проконсультируют вас относительно полученного типового или индивидуального проекта, независимо от расположения места застройщика. Все вопросы можно обговорить по скайпу, телефону, электронке или <a href="http://dom-tut.by/contacts">лично встретиться в офисе</a>.\r\n<br/><br/>\r\n<b>Заказ типовых проектов проводится:</b>\r\n<ul>\r\n<li>во время личной встречи в офисе;</li>\r\n<li>через удаленный доступ, заполнив в сети Интернет форму заказа; позвонив по телефону или же послав письмо по электронной почте;</li>\r\n<li>через официальных дилеров.</li>\r\n</ul>\r\nЕще проще сделать заказ на сайте компании – выбрать готовый типовой, затем нажать кнопку «<b>ЗАКАЗАТЬ ЗВОНОК</b>», заполнить вышедшую несложную форму онлайн. Получив заявку на проект, наш персонал обязательно найдет Вас для подтверждения данных и предоставления консультаций.\r\n<br/><br/>\r\n<b>Как оформить договор?</b>\r\n<br/><br/>\r\nНеобходимо предоставить информацию:\r\n<ul>\r\n<li>данные паспорта;</li>\r\n<li>контактный номер своего телефона;</li>\r\n<li>адрес Вашего проживания при доставке документации курьерской службой для не резидентов Республики Беларусь;</li>\r\n<li>версия и название проекта (зеркальная, оригинальная);</li>\r\n<li>копия земельно-кадастрового плана участка.</li>\r\n</ul>\r\n<b>Как оплатить проект?</b>\r\n<br/><br/>\r\nОплату можно произвести в белорусских рублях или иной валюте:\r\n<ul>\r\n<li>наличными в нашем офисе;</li>\r\n<li>банковским переводом (счет, реквизиты для оплаты придут по электронной почте);</li>\r\n<li>клиентам из Российской Федерации счет поступит в отечественной валюте или евро.</li>\r\n</ul>\r\n<b>Выполнение проекта и доставка клиенту</b>\r\n<br/><br/>\r\nКак только Вы оплатили проект, начинается подготовка документации. Длиться она может от двух дней до месяца, в зависимости от предпочтений клиента. Готовый проект будет передан Вам курьером "лично в руки". При желании можно приехать в г. Минск, посетить наш офис и лично забрать готовую документацию. Доставка курьерами индивидуальных и типовых проектов по всей территории стран СНГ осуществляется бесплатно – за счет компании.\r\n<br/><br/>\r\nЕсли заказ типового проекта стандартный, то на руки Вы получите по два одинаковых экземпляра:\r\n<ul>\r\n<li>оформленного проекта для застройщика;</li>\r\n<li>привязки проекта к земельному участку.</li>\r\n</ul>\r\n<b>Дополнения к заказу</b>\r\n<br/><br/>\r\nПомимо типового или индивидуального заказа, в нашей компании Вам могут выполнить:\r\n<ul>\r\n<li>пересчет фундаментов, адаптацию согласно условиям земельного плана и Вашей платежеспособности;</li>\r\n<li>уточнение архитектурных и конструктивных данных проекта;</li>\r\n<li>полную адаптацию типового проекта согласно собственным пожеланиям;</li>\r\n<li>индивидуальный проект, учитывающий все Ваши замечания к планировке;</li>\r\n<li>строительство дома и расчет сметы.</li>\r\n</ul>\r\nОбратившись в нашу компанию по поводу получения типового проекта постройки дома, вы не разочаруетесь. Потому что все они отличаются превосходным качеством и оригинальностью.\r\n<br/><br/>\r\n<img src="http://dom-tut.by/img/ruls.png" align="center">', 'Как заказать проект', 'как заказать проект дома, как заказать типовой проект дома', 'Как заказать типовой или индивидуальный проект дома в Беларуси у проектной мастерской Дом тут бай'),
(2, 'structure-projects', 1, 1, '2015-01-18 13:37:34', '2015-04-01 08:27:03', 1, '', '<b>Архитектурный раздел:</b>\r\n<ul>\r\n<li>Архитектурно-строительное описание</li>\r\n<li>Поэтажные планировки</li>\r\n<li>Проекция крыши</li>\r\n<li>Разрезы</li>\r\n<li>Фасады (4 проекции)</li>\r\n<li>Спецификация столярки (окна, двери и гаражные ворота)</li>\r\n</ul>\r\n<b>Конструктивный раздел:</b>\r\n<ul>\r\n<li>Конструктивно-техническое описание</li>\r\n<li>План фундаментов</li>\r\n<li>Разрезы фундаментов</li>\r\n<li>Поэтажные планировки (расположение конструкционных элементов)</li>\r\n<li>Стропильная система</li>\r\n<li>Монолитное перекрытие</li>\r\n<li>Спецификация используемой арматурной стали</li>\r\n<li>Спецификация древесины для стропильной системы</li>\r\n<li>Конструктивные детали и узлы</li>\r\n</ul>\r\n<b>*Инженерный раздел (*в адаптированных проектах оплачивается дополнительно):</b>\r\n<ul>\r\n<li>Система центрального отопления</li>\r\n<li>Газовая система (газовый котел)</li>\r\n<li>Система канализации</li>\r\n<li>Система водоснабжения</li>\r\n<li>Электроснабжение</li>\r\n</ul>\r\n<b>Информация для застройщика:</b>\r\n<ul>\r\n<li>Все типовые проекты домов можно заказать в зеркальном отображении.</li>\r\n<li>Проектная документация предоставляется в 2-х одинаковых экземплярах на русском языке.</li>\r\n<li>В стоимость каждого из проектов включена привязка проекта к земельному участку согласно действующих норм.</li>\r\n<li>Расположение дома на участке выполняется бесплатно (при наличии копии гос. акта или топосъемки 1:500)</li>\r\n<li>Возможны архитектурные и конструктивные изменения проекта согласно пожеланий.</li>\r\n<li>Если Вам не подошел ни один из типовых проектов, всегда есть возможность заказать индивидуальный проект.</li>\r\n</ul>', 'Состав проектов', 'состав проектов', 'состав проектов дом тут бай'),
(3, 'about', 1, 1, '2015-01-18 13:39:03', '2015-04-08 20:13:47', 1, '', 'Ведущей компанией в области проектирования частных домов и загородных коттеджей в Белоруссии считается <b>Проектная мастерская DOM-TUT.BY</b>. Ее история, довольно долгая и успешная, началась еще в 2006 году, когда два талантливых архитектора взялись за столь ответственное дело – подготовку строительных чертежей на заказ. Сегодня в DOM-TUT.BY – немалый штат квалифицированных сотрудников, работающих на постоянной основе и претворяющих в жизнь новые архитектурные решения.\r\n<br/><br/>\r\nКомпания является официальным представителем проектного бюро MTM STYL в Польше, функционирующем на территории России и Беларуси. За этот период ею реализовано около шести сотен разной сложности проектов, претворившихся в жизнь в виде стильных построек и коттеджей. Ежедневно специалисты Проектной мастерской DOM-TUT.BY вкладывают свои знания и опыт в достижение высокого результата.\r\n<br/><br/>\r\nВсе типовые решения выполнены на русском языке и включают полный комплект архитектурно-строительных чертежей. Купить готовые проекты сооружений в Российской Федерации и Республике Беларусь, адаптировать их к специфическим условиям местности, дополнить конструкцию вполне реально в Проектной мастерской DOM-TUT.BY. \r\n<br/><br/>\r\n<b>Основные направления деятельности:</b>\r\n<ul>\r\n<li>подготовка и претворение в жизнь типовых проектов;</li>\r\n<li>проекты под индивидуальные заказы;</li>\r\n<li>строительство различных видов домов и сооружений.</li>\r\n</ul>\r\n<br/>\r\nКомпания специализируется на подготовке архитектурных проектов частных домов, коттеджных поселков, комфортабельных особняков, коммерческой недвижимости. Наши специалисты готовы сделать Ваш дом стильным, качественным и уютным. Проекты от DOM-TUT.BY востребованы жителями городов Беларуси и России.\r\n<br/><br/>\r\n<b>Наши специалисты</b>\r\n<br/><br/>\r\nЗа годы своей плодотворной деятельности Проектная мастерская DOM-TUT.BY подготовила сильную команду профессионалов: конструкторов, инженеров, архитекторов, менеджеров и визуализаторов. Все они соответствуют современным качествам специалистов: компетентны, опытны, гибки и лояльны к заказчику. Уважительно относятся к каждому, доверившемуся компании, и стараются все их пожелания реализовать на бумаге.\r\n<br/><br/>\r\nПрофильные специалисты выслушают ваши пожелания при личной встрече или в режиме онлайн, и, в свою очередь, предоставят содержательные практические рекомендации. В течение всего проектно-строительного процесса проходят объемные консультации.\r\n<br/><br/>\r\n<b>Наша география</b>\r\n<br/><br/>\r\nПоле деятельности компании расширило свои границы. Уже реализованные проекты домов и коттеджей от DOM-TUT.BY приобрели своих хозяев в крупных городах и областных центрах Республики Беларусь и Российской Федерации.\r\n<br/><br/>\r\nБелорусские города: Минск, Брест, Витебск, Гомель, Гродно, Могилев, Слуцк, Солигорск, Червень, Фаниполь, Дзержинск, Заславль, Слоним, Барановичи, Смолевичи, Жодино, Борисов, Столбцы, Марьина Горка и Молодечно.\r\n<br/><br/>\r\nРоссийские города: Москва, Санкт-Петербург, Екатеринбург, Омск, Ростов-на-Дону, Белгород, Воронеж, Владивосток, Омск, Краснодар, Красноярск, Саратов, Оренбург, Казань, Хабаровск, Киров, Астрахань, Уфа, Тюмень и Пермь.\r\n<br/><br/>\r\nПроектная мастерская DOM-TUT.BY выполняет проекты домов согласно индивидуальным заказам жителей практически всех регионов Беларусии, России, стран СНГ. В самые жесткие сроки вы получите через курьерскую доставку «лично в руки» любой заказ, выложенный на сайте. Для тесного контакта с клиентами предлагаем все виды связи. Доступность для общения – один из важных аспектов деятельности нашей компании.\r\n<br/><br/>\r\n<b>Основные принципы деятельности компании:</b>\r\n<ul>\r\n<li>максимум внимания каждому заказчику;</li>\r\n<li>приемлемая и честная стоимость обслуживания;</li>\r\n<li>гарантия качества проектно-строительных работ;</li>\r\n<li>поручительство за каждый реализованный проект и готовую постройку.</li>\r\n</ul>\r\n<b>Наши цели и задачи</b>\r\n<br/><br/>\r\nДеятельность проектной мастерской DOM-TUT.BY направлена на стабильное развитие, которое реально лишь при качественной работе грамотного кадрового персонала, благодарных клиентах, современных проектах и положительных рекомендациях. Честность, порядочность, высокое качество, доступные цены – вот основные принципы, согласно которым строится работа компании. Приходите к нам и ваши мечты реализуются!', 'О НАС', 'представитель MTM STYL в Беларуси', 'Проектная мастерская Дом Тут бай является официальным представителем проектного бюро MTM STYL в Беларуси'),
(4, '', 1, 1, '2015-01-18 14:10:08', '2015-04-09 08:28:37', 1, '', '<h2>Добро пожаловать в проектную мастерскую DOM-TUT.BY!</h2>\r\nПроектная мастерская DOM-TUT.BY – это компания, предоставляющая свои услуги в сфере проектирования:\r\n<ul>\r\n<li>частных жилых домов;</li>\r\n<li>бань;</li>\r\n<li>террас;</li>\r\n<li>летних кухонь;</li>\r\n<li>хозяйственных построек;</li>\r\n<li>беседок;</li>\r\n<li>навесов и т.д.;</li>\r\n</ul>\r\nлюбой сложности, а также оказываем услуги по разработке дизайна интерьеров, проектов благоустройства земельных участков.\r\n<br/><br/>\r\nИстория компании начала свой отсчёт в 2013г. За этот сравнительно не большой период времени мы реализовали множество стильных, креативных и функциональных проектов домов в Республике Беларусь, Россиийской Федерации, Польше и других странах.\r\n<br/><br/>\r\n<b>Дом тут бай является единственным официальным представителем польской проектной мастерской MTM STYL на территории Республики Беларусь</b>. Мы предлагаем более 600 готовых проектов домов в Беларуси по приемлемым ценам.\r\n<br/><br/>\r\n<img src="http://dom-tut.by/img/ruls.png" align="center">', 'Индивидуальные и типовые проекты домов - Проектная мастерская Дом Тут бай', 'проекты домов, индивидуальные проекты домов, проект дома на заказ, проекты частных домов, готовые проекты домов', 'В нашем каталоге проектов более 600 домов, коттеджей и гаражей. Типовые и индивидуальные проекты домов, полный комплект, реальная стоимость от Дом Тут бай'),
(5, '3d_progulka', 1, 1, '2015-01-30 12:51:20', '2015-04-09 08:37:05', 1, '3d_progulka', '<center>\r\n<iframe width="640" height="360" src="https://www.youtube.com/embed/w37uLOpWcQw?rel=0" frameborder="0" allowfullscreen></iframe>\r\n<iframe width="640" height="360" src="https://www.youtube.com/embed/KGM6rsHQ80g?rel=0" frameborder="0" allowfullscreen></iframe>\r\n<iframe width="640" height="360" src="https://www.youtube.com/embed/KypL2pJceQE?rel=0" frameborder="0" allowfullscreen></iframe>\r\n<iframe width="640" height="360" src="https://www.youtube.com/embed/hRhvbg8oylU?rel=0" frameborder="0" allowfullscreen></iframe>\r\n<iframe width="640" height="360" src="https://www.youtube.com/embed/oJYTsrVM1qg?rel=0" frameborder="0" allowfullscreen></iframe>\r\n</center>', '3D Прогулки по нашим проектам - Смотрите видео', '3d прогулка, видео проектной мастерской Dom-Tut.by', '3D прогулка по нашим проектам. Видео проектной мастерской Dom-Tut.by'),
(6, 'custom_projects', 1, 1, '2015-01-30 12:51:37', '2015-04-02 11:00:50', 1, '', '<b>Проекты индивидуальных частных домов.</b>\r\n<br/><br/>\r\nЕсли Вы задались целью построить дом, однако не представляете себе, как он должен выглядеть – просто подберите необходимое фото в интернете или набросайте собственный проект. Также у нас Вы сможете воспользоваться услугами нашего архитектора, в ходе встречи с которым Ваши идеи будут воплощены на бумаге. В случае возникновения дополнительных вопросов наши заказчики всегда могут получить консультацию по телефону.\r\n<br/><br/>\r\nМы выполняем заказы на разработку таких проектов жилых домов, как:\r\n<ul>\r\n<li>Индивидуальная проектировка коттеджей</li>\r\n<li>Индивидуальная проектировка особняков</li>\r\n<li>Индивидуальная проектировка деревянных домов, выполняемых из бревна, бруса или клееного бруса</li>\r\n<li>Индивидуальная проектировка домов из монолитного бетона, газобетона или из пеноблоков</li>\r\n<li>Индивидуальная проектировка кирпичных домов</li>\r\n<li>Индивидуальная проектировка каркасных домов</li>\r\n<li>Индивидуальная проектировка жилых домов на две семьи</li>\r\n<li>Индивидуальная проектировка домов с гаражом, мансардой, а также современных автономных энергоэффективных домов</li>\r\n</ul>\r\n<b>Преимущества домов, выполненных по специальным проектам:</b>\r\n<ul>\r\n<li>До 30% экономия средств на материалах, что становится возможным благодаря индивидуальному подходу при проектировке фундамента под Вашу застроечную площадь, а также рационализации проектов перекрытий и проч.</li>\r\n<li>Оригинальные дизайнерское решение фасада дома и кровли, созданные по индивидуальному заказу</li>\r\n<li>Огромный ассортимент строительных и отделочных материалов</li>\r\n<li>Разработка проектов коттеджей и домов нестандартных форм и размеров</li>\r\n<li>Планировка в соответствии с индивидуальными предпочтениями заказчика</li>\r\n</ul>\r\n<b>Индивидуальные проекты домов</b>\r\n<br/><br/>\r\nКаждый представленный проект создавался с нуля согласно конкретным желаниям заказчика – начиная с разработки заданной модели и заканчивая внедрением конструктивных новейших решений. В результате отлаженной работы наши клиенты получают такие проекты жилых домов, которые отвечают их пожеланиям: уникальное внешнее оформление, нестандартная планировка и т.д. Все проекты рассчитываются согласно выбранным заказчиком материалам.\r\n<br/><br/>\r\nНа сегодняшний день многие дома по выполненным нашими специалистами проектам уже построены. Те из них, которые еще находятся на стадии строительства, подвергаются регулярному авторскому надзору.\r\n<br/><br/>\r\nСегодня большинство людей, имеющих собственный земельный участок под постройку, начинают строительные работы с заказа индивидуального проекта. И это является наиболее правильным и разумным решением, так как только архитектор способен проинструктировать строителей соответствующим образом, контролируя весь рабочий процесс создания жилого дома.', 'Проекты индивидуальных жилых домов', 'проекты домов, проекты индивидуальных домов', 'Если вам нужен индивидуальный проект частного жилого дома, то мы обязательно вам поможем'),
(7, 'kak_podobrat_proekt', 1, 2, '2015-02-22 23:15:03', '2015-02-22 23:15:34', 1, 'Для того, чтобы из большого количества предлагаемых проектов домов подобрать именно тот, что вам нужен, необходимо, в первую очередь, смотреть не на внешний вид дома, а на планировку.', '<p>Для начала нужно четко иметь представление кто будет проживать в этом доме: дети, родители, бабушки, гости и т.д. Необходим ли в таком случае рабочий кабинет, гараж, комната для отдыха, библиотека, подвал и другие помещения. Если в доме будет проживать молодая семья, необходимо иметь в перспективе возможность переделать одну из комнат в детскую.</p>\r\n\r\n<p>Этажность. Наличие подвала у многих застройщиков вызывает сомнение. Другие считают, что если немножко ниже опустить фундамент, можно получить полноценный этаж. На самом же деле это очень дорогое удовольствие. Во-первых, очень многое зависит от геологии. Ввиду особенностей грунта подвал может затапливаться, что понесет за собой дополнительные убытки. И в целом же, проектирование подвала требует вдумчивого подхода, а также немалых денежных средств на реализацию данной идеи: создание нужной теплоизоляции и гидроизоляции, дренаж, электрика, отопление, полы и окна. Каждый из этих пунктов подразумевает под собой немалые денежные вложения. В этом случае гораздо проще сделать дополнительные помещения на поверхности. Так, можно создать сарай или погреб для дополнительных нужд. Можно также часть функций подвала перенести в сам дом. И не стоит думать, что маленький погребок позволит сэкономить на целом подвале. Это не так. Следует знать, что нельзя ослаблять несущие стены дома, нельзя просто взять и понизить в любом месте стену дома и сделать возле неё подвал. Нормы допускают перепад на 1 метр - 30см чтобы не было резких перепадов по нагрузкам, да и несущая способность грунта в местах резкого перепада будет сильно нарушена и как следствие &ndash; трещины по дому. Если уж очень хочется погребок, то необходимо будет отступить от несущих стена метра по два минимум и тогда можно будет сделать погребок высотой тоже метра два. Как вы поняли помещение для такой конструкции нужно шириной около 6 метров.</p>\r\n\r\n<p>Экономить можно и на гараже. В современных условиях гараж все меньше выполняет свою основную функцию (место для автомобиля), а превращается все в тот же сарай. Хозяева дома предпочитают складировать в гаражах редко используемые вещи, заполняя тем самым полезное пространство. Не стоит забывать и о том, что хоть гараж и находится при доме, машина в зимний период все же будет &laquo;мерзнуть&raquo; в нем. Это значит, что в гараже тоже нужно проводить полноценное отопление и продуманно заниматься его обустройством.</p>\r\n\r\n<p>Мансардный этаж &ndash; один из распространенных мифов в современном строительстве, призванный, как полагается, сэкономить большое количество денежных средств. Но на самом деле реализация проекта с мансардой оборачивается затратами почти как на строительство полноценного второго этажа.</p>\r\n\r\n<p>О площадях. Оптимальной площадью для гостиной считается 25 -35 и более квадратных метров. Если гостиная совмещенная (к примеру, с кухней или столовой), то допустимо и 50 квадратных метров. Жилые комнаты &ndash; 11-18 кв.м. или 20 при необходимости.</p>\r\n\r\n<p>Уже только когда все вопросы с количеством комнат и их размером решены, можно приступать к проектированию внешнего вида. Здесь строгих рамок нет &ndash; все зависит сугубо от вкуса, тем более что в современных условиях любой проект внешнего оформления, даже самый смелый, может быть без труда реализован.</p>\r\n', 'Как подобрать проект?', '', ''),
(8, 'winter_construction', 2, 2, '2015-02-26 21:08:31', '2015-02-27 02:34:27', 1, 'Начало строительных работ, как правило, планируют на конец осени — время сбора урожая и окончания дачного сезона. Многие, естественно, желают сэкономить на строительных и отделочных материалах, а этот период самый удачный для выгодных приобретений такого рода, ведь цены зимой становятся значительно ниже...', '<h2>Лучшее время для строительства</h2>\r\n\r\n<p>А вот в весенне-летний период стоимость как материалов, так и услуг в данной сфере резко возрастает, так как растёт и спрос на них. Приемлемая цена на необходимые материалы &mdash; это один из плюсов зимнего строительства. Просмотреть варианты и, возможно, даже заказать понравившийся вам проект можно, к примеру, на любом специализированном ресурсе.</p>\r\n\r\n<h2>Возведение дома из дерева</h2>\r\n\r\n<p>Возведение деревянного дома в зимний период является оптимальным вариантом по нескольким причинам: 1. Вы сможете неплохо сэкономить на противоморозных добавках для бетона, так как при строительстве применяются нагеля и гвозди. 2. Структура дерева не загнивает и не деформируется во время холодов, а получается даже более сухой, плотной. А это говорит о том, что ваша постройка скорее осядет, и в тёплое время года, вполне возможно, завершение отделочных и ремонтных работ. А после приступать к самому приятному &ndash; обустройству интерьера.</p>\r\n\r\n<h2>Строительство кирпичного дома</h2>\r\n\r\n<p>При возведении кирпичного дома обязательно следует принимать во внимание некоторые нюансы &laquo;создания&raquo; аналогичных зданий в холодный период. Также должна быть готова основа дома, а, как известно, закладку фундамента рекомендуют проводить, когда тепло. Заливка же его в холода требует наличия морозостойкого бетона. Стоимость такого стройматериала более высокая, нежели обычный бетон. Использование специальных дорогих противоморозных добавок также будет обязательным. Их применение иногда несколько портит &laquo;лицо&raquo; постройки. Связано это с тем, что кирпичная кладка довольно часто покрывается светлым налётом, а устранить такую проблему крайне сложно.</p>\r\n\r\n<h2>Монтаж крыши зимой</h2>\r\n\r\n<p>На зиму вполне можно запланировать и монтаж крыши. Использовать для этого можно практически любые стройматериалы. Единственное, чем всё же нежелательно покрывать крышу &ndash; гибкой черепицей. Этот материал крошится на морозе. Применение гибкой черепицы, возможно, если изредка нагревать её, чтобы исключить деформацию. Короткий световой день и &laquo;сюрпризы&raquo; погоды &ndash; это те факторы, которые могут несколько затруднить и затянуть строительный процесс зимой.</p>\r\n', 'Зимнее строительство: плюсы и особенности', '', ''),
