(73, 'szyper_6_dr-s', 'Шкипер 6 др-С (Szyper 6 dr-S)', '<li><span>Стены:</span><span> деревянный каркас</span></li>\r\n<li><span>Перекрытия:</span><span> деревянные балки</span></li> \r\n<li><span>Крыша:</span><span> битумная черепица</span></li>\r\n<li><span>Уклон кровли </span><span> 30°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 1, 1, 1, 1, 1, 4, 1, 0, 255, 47.42, 400, '0000-00-00 00:00:00', '2015-04-01 09:07:48', '', '', ''),
(74, 'amarant_mc', 'Амарант МС (Amarant MC)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + минеральная вата ISOVER </span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> керамическая черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 30°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 2, 1, 1, 1, 1, 4, 0, 582, 123.9, 550, '0000-00-00 00:00:00', '2015-04-01 09:08:04', '', '', ''),
(75, 'aksamit_3', 'Аксамит 3 (Aksamit 3)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 1, 1, 1, 1, 1, 4, 4, 2, 898.15, 156.42, 550, '0000-00-00 00:00:00', '2015-04-01 09:08:21', '<b>Монтаж сайдинга на обрешетку.</b>\r\n<br/><br/>\r\nВладельцы домов выбирают сайдинг для проведения облицовки фасада в том числе по той причине, что этот материал отличается предельной простотой при монтаже. Но основные требования, которые предъявляются к этому мероприятию, должны соблюдаться неукоснительно, чтобы результат был лучше.\r\n<br/><br/>\r\n<b>Подготовка поверхности под монтаж сайдинга</b>\r\n<br/><br/>\r\nЗакреплять панели сайдинга можно непосредственно на основание стен дома. Но такой метод менее практичен, поскольку он не позволяет добиться идеально гладкой поверхности облицовки, а также лишает владельцев возможности использовать дополнительные изоляционные материалы. Поэтому более грамотным методом будет размещение сайдинга на обрешетку.\r\n<br/><br/>\r\nОбычно сайдинг крепится на стенах дома горизонтально. Поэтому обрешетка должна быть вертикально ориентированной. Ее лучше выполнить из алюминиевых профилей, которые обладают небольшим весом и прекрасно противостоят коррозионным процессам. Размещать профили нужно на таком расстоянии, чтобы панель сайдинга можно было прихватить минимум в трех местах. Обычно это расстояние составляет около 70 см.\r\n<br/><br/>\r\n<b>Выполнение изоляционный прослойки</b>\r\n<br/><br/>\r\nМежду элементами обрешетки можно поместить изоляционный материал, который увеличивает функциональность жилища в целом. При работе на фасаде дома лучше всего использовать такой теплоизоляционный материал, как минеральная вата. Она закладывается между элементами обрешетки и дополнительно защищается гидроизоляционным слоем, поскольку влага такому утеплителю способна очень сильно навредить.\r\n<br/><br/>\r\n<b>Крепление сайдинга к обрешетке</b>\r\n<br/><br/>\r\nНачинать монтировать панели сайдинга необходимо с нижней части стены. Первая панель располагается таким образом, чтобы ее гребень смотрел вверх. К обрешетке материал может быть прикреплен простыми саморезами, дюбелями или кляммерами. Последний крепежный элемент дает возможность выполнить так называемую скрытую облицовку, которая не сказывается отрицательно на эстетичности отделке. Следующая панель вставляется пазом в гребень предыдущей и таким же образом прикрепляется к обрешетке.\r\n<br/><br/>\r\n<b>Декорирование облицовки из сайдинга</b>\r\n<br/><br/>\r\nПо углам дома необходимо закрепить дополнительные доборные элементы. Они могут имитировать самые разные варианты материалов. Например, доборные элементы способны выглядеть так же, как углы кирпичной кладки или кладки из декоративного камня. Как бы то ни было, результат облицовки получится отличным.', 'обрешетка сайдинг, крепление сайдинга', 'Как правильно прикрепить сайдинг и сделать обрешетку'),
(76, 'duet', 'Дуэт (Duet)', '<li><span>Стены:</span><span> из блоков YTONG толщиной 36,5 cм </span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> керамическая черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 45°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 0, 2, 1, 3, 1, 1, 6.77, 140.25, 405, '0000-00-00 00:00:00', '2015-04-01 09:08:35', '', '', ''),
