(90, 'amarylis_mc', 'Амарилис МС (Amarylis MC)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + минеральная вата ISOVER </span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> металлочерепица</span></li> \r\n<li><span>Уклон кровли</span><span> 40°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 2, 1, 1, 1, 1, 4, 2, 792, 139.4, 600, '0000-00-00 00:00:00', '2015-04-01 09:15:12', '', '', ''),
(91, 'ariel_3', 'Ариель 3 (Ariel 3)', '<li><span>Стены:</span><span> 2-х слойная, блоки газобетон SOLBET 24 см + пенополистирол </span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>\r\n', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 1068.04, 128.43, 550, '0000-00-00 00:00:00', '2015-04-01 09:15:27', '<b>Бревно ручной рубки и оцилиндрованное бревно.</b>\r\n<br/><br/>\r\nБревенчатые дома в первую очередь ценятся за характерный внешний вид. Такие постройки напоминают те, что были в русских деревнях на протяжении многих веков. Сегодня застройщики прибегают к применению этого материала, поскольку бревно обладает немалым числом плюсов. Но есть два принципиально разных типа такого материала. Особенности каждого необходимо принимать во внимание.\r\n<br/><br/>\r\n<b>Бревно ручной рубки</b>\r\n<br/><br/>\r\nЭто тот материал, который использовался на протяжении длительного времени для строительства простых деревянных домов в деревнях и селах. Бревно ручной рубки изготавливается без применения каких-либо сложных технологий. Основным инструментом для его создания является обычный топор.\r\n<br/><br/>\r\nПоэтому стоимость бревна получается не очень высокая. Скромная цена материала считается его основным преимуществом. Можно и самостоятельно изготовить такой материал, если всего лишь обтесать топором ствол дерева. Но такой подход к изготовлению материала приводит к появлению заметных недостатков.\r\n<br/><br/>\r\nГеометрические параметры бревна ручной рубки далеко не идеальны. Подгонять венцы дома в процессе укладки приходится долго. Такая процедура требует заметных затрат сил. И все равно могут остаться внушительные щели между соседними бревнами. Бревно ручной рубки не подвергается специальным методам защитной обработки. В отношении него не проводится искусственная сушка.\r\n<br/><br/>\r\n<b>Оцилиндрованное бревно</b>\r\n<br/><br/>\r\nТакой материал пришел на смену бревну ручной рубки. Его отличительная черта в том, что изготовление оцилиндрованного бревна проводится в заводских условиях. На специальных станках ствол дерева оцилиндровывается, в результате чего ему предаются идеальные геометрические параметры. По всей длине оцилиндрованное бревно имеет одинаковый диаметр.\r\n<br/><br/>\r\nИз-за такого метода изготовления оцилиндрованное бревно стоит дороже предыдущего. Зато в работе оно отличается простотой. Оцилиндрованное бревно обладает специальными пазами для плотной укладки венцов. Его подвергают защитной обработке, в результате чего стены дома становятся надежными и не боящимися воздействия влаги, насекомых и других негативных факторов.\r\n<br/><br/>\r\n<b>Какой материал выбрать?</b>\r\n<br/><br/>\r\nЗастройщик может сам решить, какой материал использовать для возведения дома. Но все-таки оцилиндрованное бревно отличается большей функциональностью, поэтому его использование становится по-настоящему рациональным решением.', 'бревно ручной рубки, бревно рубленное', 'Рубленное вручную бревно можно сделать практически любого размера, потому что тут нету почти никаких ограничений'),
