(125, 'grot', 'Грот (Grot)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица </span></li> \r\n<li><span>Уклон кровли</span><span> 33°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 3, 0, 1, 1, 4, 1, 0, 394, 92.5, 500, '0000-00-00 00:00:00', '2015-04-01 10:24:35', '', '', ''),
(126, 'kurant', 'Курант (Kurant)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 45°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 1, 1, 0, 1, 1, 1, 1, 1, 730.7, 136.4, 600, '0000-00-00 00:00:00', '2015-04-01 10:24:59', '', '', ''),
(127, 'decyma_3', 'Декума 3 (Decyma 3)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li> \r\n<li><span>Перекрытия:</span><span> стропильные фермы </span></li>\r\n<li><span>Крыша:</span><span> металлическая черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 30°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 1, 1, 1, 4, 4, 0, 590, 87.39, 550, '0000-00-00 00:00:00', '2015-04-01 10:25:12', '<b>Способы утепления крыши дома.</b>\r\n<br/><br/>\r\nДля достижения наиболее качественной теплоизоляции жилого дома проводить утепление необходимо в отношении каждого его элемента. В том числе, теплоизоляция требуется и крыше дома. Но проводить ее можно разными способами. В зависимости от этого подбирается и подходящий утеплитель.\r\n<br/><br/>\r\n<b>Утепление дома без мансарды</b>\r\n<br/><br/>\r\nЕсли в доме отсутствует мансарда, то утепление становится довольно простой задачей. Необходимо лишь преградить пути потери тепла из помещений постройки. С этой целью утеплитель укладывается по поверхности пола чердака, а после этого закрывается напольным покрытием.\r\n<br/><br/>\r\nТакой метод предполагает применение небольшого количества теплоизоляционных материалов. В роли утеплителя прекрасно подойдет минеральная вата. Только стоит помнить о том, что дополнительно нужно обеспечить гидроизоляцию, чтобы теплоизоляционные материалы не были испорчены в результате контакта с влагой. Плиты минеральной ваты легко укладывать по полу чердака, что позволяет обойтись минимальными затратами сил.\r\n<br/><br/>\r\n<b>Утепление мансардной крыши</b>\r\n<br/><br/>\r\nДом с мансардой отличается большей функциональностью, но утепление крыши в любом случае способно предоставить серьезные проблемы. Тем не менее, такая ситуация возникает не всегда. Не каждому владельцу требуется жилая мансарда, поэтому утепление крыши может быть проведено и по предыдущей технологии. Только стоит помнить о том, что в результате сама мансарда сможет использоваться для проживания только в теплое время года.\r\n<br/><br/>\r\nДругое дело – создание жилой мансарды. При наличии такой задачи обойтись утеплением одного лишь пола чердака не удастся. Придется утеплять скаты крыши. С этой целью на них закрепляется теплоизоляционный материал, который не дает теплу уходить из самой мансарды.\r\n<br/><br/>\r\nПлощадь покрытия при таком варианте достаточно велика, поэтому приходится использовать большее количество утеплителя. Осуществить процедуру лучше всего с помощью такого теплоизоляционного материала, как пенополистирол. Он обладает хорошими теплоизоляционными способностями, но при этом имеет небольшую толщину. Поэтому площадь мансарды практически не уменьшается.\r\n<br/><br/>\r\n<b>Дополнительные возможности утепления крыши</b>\r\n<br/><br/>\r\nУвеличить теплоизоляцию при любом из описанных способов удастся, если в целях финишной отделки использовать древесину. Скаты крыши можно покрыть деревянной вагонкой, а на пол чердака настелить простую массивную доску. В итоге утепление станет заметно более выраженным.', 'способы утепления крыши, как утеплить крышу', 'Получаем выгоду до 20% от правильного утепления крыши'),
