(152, 'ariel', 'Ариель (Ariel)', '<li><span>Стены:</span><span> 2-х слойная, блоки газобетон SOLBET 24 см + пенополистирол </span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 798.4, 128.35, 550, '0000-00-00 00:00:00', '2015-04-01 15:08:08', '<b>Применение разных видов бруса.</b>\r\n<br/><br/>\r\nДля строительства дома можно прибегать к применению материалов различного характера. Древесина среди них до сих пор пользуются востребованностью. Но сегодня из древесины выполняется много вариантов строительных материалов. Самый обыкновенный брус изготавливается в нескольких видах, различающихся практическими характеристиками.\r\n<br/><br/>\r\n<b>Строганный брус в строительстве</b>\r\n<br/><br/>\r\nЭто самый дешевый из существующих видов бруса, который обладает некоторыми недостатками. Брус такого типа изготавливаются вручную. Процесс изготовления предполагает, что ствол дерева обтесывается специальными инструментами. Для придания ему гладких плоскостей приходится затрачивать много усилий.\r\n<br/><br/>\r\nВ процессе строительства дома из строганного бруса возникает немало сложностей. Приходится подравнивать материал, что вызывает потребность в участии специалистов в ходе подобного мероприятия. В качестве еще одного минуса строганного бруса следует отметить его высокую влажность.\r\n<br/><br/>\r\n<b>Профилированный брус в строительстве</b>\r\n<br/><br/>\r\nОтличительная черта профилированного бруса заключается в том, что он изготавливается в заводских условиях. По этой причине такой материал отличается выверенными геометрическими параметрами. Он не только имеет абсолютно гладкие плоскости, но и обладает специальными пазами для сборки коробки дома.\r\n<br/><br/>\r\nРаботать с профилированным брусом намного проще, а влажность его невелика. Поэтому постройку получается возвести значительно быстрее, а также перейти к отделочным работам через непродолжительный период после строительства жилища. Зато для приобретения профилированного бруса требуется больше средств, чем для покупки строганого.\r\n<br/><br/>\r\n<b>Клееный брус в строительстве</b>\r\n<br/><br/>\r\nКлееный брус считается самым совершенным вариантом стройматериалов из древесины. По своей структуре он отличается от строганого или профилированного. Клееный брус составляется из нескольких отдельных досок, которые склеены друг с другом. Благодаря подобному подходу к производству удается сделать материал максимально надежным и долговечным.\r\n<br/><br/>\r\nИз преимуществ клееного бруса необходимо отметить простоту укладки, низкий уровень влажности, эстетичный внешний вид. Несмотря на то, что при изготовлении клееного бруса применяется клей, материал все равно остается экологически чистым. Но и стоимость его намного выше, чем у других материалов. Поэтому застройщику приходится затрачивать немало денежных средств.', 'виды бруса, виды деревянного бруса', 'Строганный брус из дерева, его виды, преимущества клееного бруса и его применение'),
