(209, 'bryza', 'Бриза (Bryza)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li>\r\n<li><span>Уклон кровли</span><span>40°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 0, 1, 1, 1, 1, 1, 518, 110.8, 500, '0000-00-00 00:00:00', '2015-04-02 09:35:50', '', '', ''),
(210, 'ambrozja_4', 'Амброзия 4 (Ambrozja 4)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li>\r\n<li><span>Уклон кровли</span><span>25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 1128.34, 135.55, 600, '0000-00-00 00:00:00', '2015-04-02 09:36:05', '<b>Отделочный материал: древесина.</b>\r\n<br/><br/>\r\nС каждым годом все больше городских жителей стремятся иметь свой собственный загородный дом. Следовательно, растет спрос на древесное сырье. Современный деревянный дом – наиболее выгодный вариант для жизни человека за городом. Древесина, являясь экологически чистым, надежным и доступным материалом, востребована в строительстве, как в нашей республике, так и за рубежом. А деревянные дома популярны, соответственно, за свои уникальные качества, которые положительно влияют на здоровье человека. Высокий уровень экологичности дополняется приятной домашней атмосферой, которая создается в каждом помещении.\r\n<br/><br/>\r\nДеревянные дома привлекают внимание не только своим красивым внешним видом, но и очень хорошими качествами: надежность, прочность, устойчивость к деформации. Только владельцам необходимо ухаживать за домом, покрывать дерево специальными защитными средствами. \r\n<br/><br/>\r\nСамое главное для начала постройки дома – это правильно выбрать породу дерева. Тщательно выбирая вид древа, нужно помнить, что строительство дома долгий процесс, а построенное здание должно быть комфортным, красивым, надежным.\r\n<br/><br/>\r\n<b>Древесину разделяют на хвойную породу и лиственную.</b>\r\n<br/><br/>\r\nЛиственная порода (липа, клен, бук, ясень, липа) обладает высокой надежностью и твердостью. Материал из такого вида достаточно гибкий, не притязателен к пропитке и обработке, что существенно для строительных работ. Однако, лиственница считается плотным сырьем, а, значит, существуют определенные трудности при ее обработке.\r\n<br/><br/>\r\nХвойная порода (ель, сосна, пихта, кедр) достаточно крепкая, ее плотность сравнительно небольшая. Для строительства дома породы хвойных деревьев используются чаще. Самые популярные виды – это сосна и ель, так как имеют в своем составе плотные волокна. Пихта и ель применяются реже.\r\n<br/><br/>\r\nЗначительное преимущество любой древесины в том, что она почти не гниет, стойко выдерживает высокую влажность воздуха и большие температурные колебания. Такие качества определяет востребованность дерева в качестве строительного материала для деревянного дома, деревянных межкомнатных и входных дверей, бани, коттеджа.', 'древесина в отделке, отделка древесиной', 'Как отделывать стены древесиной правильно, чтобы красиво и долговечно'),
(211, 'elka_3', 'Елка 3 (Elka 3)', '<li><span>Стены:</span><span> из блоков YTONG толщиной 36,5 cм + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> монолитное железобетонное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li>\r\n<li><span>Уклон кровли:</span><span> 25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 0, 0, 0, 3, 1, 1, 1, 4, 4, 0, 576.52, 91.64, 480, '0000-00-00 00:00:00', '2015-04-02 09:36:18', '', '', ''),
(212, 'pliszka_2', 'Пличка 2 (Pliszka 2)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> битумная черепица или мтеллочерепица</span></li>\r\n<li><span>Уклон кровли</span><span>42°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 2, 1, 1, 1, 1, 1, 0, 517, 123.8, 500, '0000-00-00 00:00:00', '2015-04-02 09:36:30', '', '', ''),
(213, 'jezyna', 'Джезина (Jeżyna)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> металлический лист (фальцевая кровля) Classic (Ruukki)</span></li> \r\n<li><span>Уклон кровли </span><span> 42°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 2, 1, 1, 1, 1, 4, 0, 693.82, 137.85, 550, '0000-00-00 00:00:00', '2015-04-02 09:36:44', '<b>Преимущества и недостатки текстильных обоев.</b>\r\n<br/><br/>\r\nИнтересным отделочным материалом для приведения стен в порядок являются текстильные обои, популярность которых постепенно увеличивается. Не стоит думать, что текстиль для покрытия стен начали использовать недавно. На самом деле, история его применения достаточно велика. Но только в последние годы стала распространена «удобная» форма этого материала, то есть обои. Обращаться с ними намного проще, чем с обычными текстильными полотнами.\r\n<br/><br/>\r\n<b>Что такое текстильные обои</b>\r\n<br/><br/>\r\nСтруктура текстильных обоев образуется несколькими слоями. Основным из них является бумага или флизелин. Именно этот материал отвечает за прикрепление обоев к поверхности. Флизелин и бумага отлично сцепляются с основанием при помощи обычного клея, что и заметно упрощает применение текстильных обоев.\r\n<br/><br/>\r\nЛицевая сторона обоев подобного типа образована такими материалами, как лен, фетр, хлопок и так далее. Текстильные обои могут быть натуральными или синтетическими. Но в любом случае их преимущества оказываются довольно значительными, что очень легко подтвердить в процессе эксплуатации.\r\n<br/><br/>\r\n<b>Преимущества текстильных обоев</b>\r\n<br/><br/>\r\nОсновным плюсом текстильных обоев обычно называют их презентабельный внешний вид. Действительно, текстиль может иметь самые разные варианты текстуры, поэтому при помощи данного материала удается облагородить интерьер любого помещения, сделать его более роскошным и изысканным. Текстильные обои создают очень уютную обстановку, поэтому они прекрасно подходят для оформления гостиных или спален.\r\n<br/><br/>\r\nНо и практические качества материала можно оценить довольно высоко. Обои с текстильным слоем отличаются высочайшим уровнем тепло- и звукоизоляции. К тому же они невероятно долговечны и прекрасно противостоят воздействию ультрафиолета. А благодаря тому, что отделка такого типа легко пропускает воздух, в помещении всегда будет присутствовать благоприятный микроклимат.\r\n<br/><br/>\r\n<b>Недостатки текстильных обоев</b>\r\n<br/><br/>\r\nИ все-таки минусы у этого материала также присутствуют. В качестве одного из них следует назвать склонность к загрязнениям, что приводит к необходимости постоянно вести за ними пристальный уход. Текстильные обои способны достаточно быстро испортиться от повышенной влажности воздуха, а также легко впитывают запахи. Поэтому на кухне их использовать точно нельзя. Зато при правильном обращении с этим материалом удается надолго получить качественную и невероятно эстетичную отделку.', 'текстильные обои преимущества, текстильные обои недостатки', 'Текстильные обои набирают популярность благодаря своим преимуществом над недостатками других'),
