(272, 'ambrozja', 'Амброзия (Ambrozja)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li>\r\n<li><span>Уклон кровли</span><span> 25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 852.2, 137, 400, '0000-00-00 00:00:00', '2015-04-02 10:44:33', '<b>Выбор кровельного профнастила.</b>\r\n<br/><br/>\r\nВ строительстве любого здания, будь то торговый центр или жилой дом, может использоваться такой универсальный материал, как профнастил. Он подходит для обустройства кровли, для обшивки фасада. Из него возводят ограждения и заборы, изготавливают хозяйственные постройки. Профилированный лист - это безопасный в плане экологии материал, имеющий невысокую стоимость и при этом качественный, удобный в монтаже. Эти характеристики сделали профнастил востребованным, а в некоторых случаях и незаменимым материалом в строительстве.\r\n<br/><br/>\r\nПрофнастил обладает как достоинствами, так и недостатками, что, впрочем, характерно для всех стройматериалов. Но с учетом его дешевизны и огромной сферы применения можно пренебречь некоторыми его недостатками. Например, склонность к коррозии в результате повреждения защитного покрытия, невысокая устойчивость к взлому конструкций из профнастила. И все-таки преимущества материала полностью перекрывают его недостатки:\r\n<br/><br/>\r\n- профнастил доступен для любого потребителя;\r\n- удобен в перевозке;\r\n- удобен в установке, не требует грузоподъемного оборудования;\r\n- отличается долговечностью, которая составляет порядка 50 лет;\r\n- способен выдерживать большие нагрузки;\r\n- не боится неблагоприятных климатических воздействий;\r\n- при надлежащем обращении не ржавеет и сохраняет первоначальный цвет.\r\n<br/><br/>\r\nЧтобы профнастил сохранял свои преимущества, его нужно правильно устанавливать. Для крепления листов используют саморезы с резиновыми шайбами. При этом появляются отверстия, которые необходимо обрабатывать герметиком.\r\n<br/><br/>\r\nОбласть применения материала предполагает два варианта назначения. Во-первых, он может использоваться для строительства заборов и стен легких сооружений, изготовления перегородок, конструкций, выполняющих несущую функцию. Для этих целей применяют профнастил с ребрами жесткости. Во-вторых, материал может применяться как кровельное покрытие. Листы кровельного профнастила обычно имеют защитный слой из полимерного состава, повышающего его устойчивость к негативным воздействиям, механическим повреждениям. Листы с ребрами жесткости подходят для покрытия крыш с пролетами длиной до 3 метров.\r\n<br/><br/>\r\nВ загородном домостроении чаще всего применяют стеновой профилированный лист с небольшим профилем, тогда как для сооружения кровли используют листы со средним и крупным профилем.\r\n<br/><br/>\r\nПо типу покрытия профнастил подразделяется на оцинкованный, с полимерным покрытием. Последний вариант более надежен в плане устойчивости к коррозии и выгоранию на солнце.', 'профнастил выбор, выбор профнастила для кровли', 'Совет выбирать профнастил для кровли учитывая приведенные недостатки и достоинства'),
