(306, 'ambrozja_2', 'Амброзия 2 (Ambrozja 2)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li>\r\n<li><span>Уклон кровли </span><span> 30°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 1, 1, 1, 1, 4, 2, 1274, 215.77, 600, '0000-00-00 00:00:00', '2015-04-02 11:07:49', '<b>Что особенного в пенобетоне.</b>\r\n<br/><br/>\r\nВ наше время в строительстве применяются все новые и новые материалы и технологии. Большую популярность  в последнее время приобрели и блоки из пенобетона.  Хотя его нельзя назвать новым в полном смысле этого слова. Пенобетон начали применять еще в начале прошлого века, и он  получил широкое распространение во многих странах мира. Сегодня в нашей стране он переживает второе рождение. Пеноблоки используются как для строительства гражданских объектов, так и в промышленном строительстве. Некоторые объясняют этот факт  доступной ценой пеноблоков, но дело не только в этом.\r\n<br/><br/>\r\nБлоки из пенобетона обладают хорошими термоизоляционными характеристиками, что позволяет строить здания с меньшей толщиной несущих стен без ущерба показателей теплосопротивления. Если говорить проще, то стены из пеноблоков теплые и при меньшей толщине конструкции. Если сравнивать пеноблоки с другими строительными материалами, например, бетоном и кирпичом, то вес пеноблоков значительно меньше, что позволяет экономить на фундаменте.\r\n<br/><br/>\r\nКонечно, пеноблоки имеют и слабые стороны. Если сравнивать их с кирпичом, то можно сказать, что они менее прочные. По этой причине блоки из пенобетона применяют в строительстве малоэтажных зданий. На этом недостатки этого материала заканчиваются. На рынке строительных материалов в наше время можно найти усовершенствованные варианты пеноблоков, которые имеют более высокие прочностные характеристики, что расширяет сферу их использования.\r\n<br/><br/>\r\nПеноблоки идеально подходят для возведения внутренних перегородок и стен в малоэтажных домах. Этот материал имеет очень хорошую звукоизоляцию, также славится высокими показателями паропроницаемости и пожарной безопасностью.  По этим причинам в помещениях, где стены возведены из пеноблоков тепло, безопасно и тихо.\r\n<br/><br/>\r\nТехнология, по которой изготавливаются блоки из пенобетона, позволяет создать широкий ассортимент блоков. Пеноблоки изготавливаются различных размеров и форм, могут иметь пазы и фаски, а также другие элементы.\r\n<br/><br/>\r\nСтроить различные конструкции из пеноблоков легко и просто, так как они легкие и ровные. Из этого материала можно строить не только прямые стены и перегородки, но и конструкции различных форм, так как блоки можно обрабатывать пилой или фрезой.', 'особенности выбора пенобетона, особенности пенобетона', 'Особенности блоков из пенобетона, совет как правильно выбрать'),
(307, 'decyma', 'Декума (Decyma)', '<li><span>Стены:</span><span> 2-х слойная,  пустотелый керамический блок + утепление</span></li>\r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> керамическая черепица</span></li>\r\n<li><span>Уклон кровли </span><span> 25°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 990, 141.52, 550, '0000-00-00 00:00:00', '2015-04-02 11:08:03', '<b>Сайдинг при внешней облицовке: возможности и разновидности.</b>\r\n<br/><br/>\r\nОблицовочные работы могут проводиться с применением в том числе такого материала, как сайдинг. Владельцы жилища ценят это облицовочное покрытие по той причине, что оно отличается долговечностью и не слишком высокой стоимостью. За сайдингом легко ухаживать, поэтому облицовку получается сохранить в хорошем состоянии без значительного труда.\r\n<br/><br/>\r\n<b>Возможности применения сайдинга</b>\r\n<br/><br/>\r\nВ большинстве случаев сайдинг используется для облицовки фасадов. Материал прекрасно подходит в целях выполнения внешних отделочных процедур, поскольку любой его вариант хорошо выдерживает негативные атмосферные воздействия, а также интересно смотрится. Толщина панелей сайдинга может достигать 10 мм. Длина каждого элемента составляет до 6 м, что дает возможность проводить облицовку очень быстро.\r\n<br/><br/>\r\nКонкретные характеристики сайдинга определяются тем, какой именно его вид используется для выполнения необходимых работ. Существует несколько разновидностей сайдинга, различающихся в первую очередь материалом изготовления.\r\n<br/><br/>\r\n<b>Особенности разных видов сайдинга</b>\r\n<br/><br/>\r\n1. Виниловый сайдинг. Применяется примерно в 60% случаев. К его использованию владельцы жилищ обращаются по той причине, что он совмещает хорошую функциональность и не очень высокую стоимость. Виниловый сайдинг обладает небольшим весом, очень быстро монтируются. ПВХ, который применяется для его изготовления, обладает гибкостью, поэтому даже на неровной поверхности он смотрится очень хорошо. За счет того, что виниловый сайдинг может имитировать другие материалы, облицовка из него получается очень эффектной.\r\n<br/><br/>\r\n2. Стальной сайдинг. Используется преимущественно в целях облицовки зданий промышленного назначения. Показывает в первую очередь огромную прочность. Но такой материал при сильных ударах может прогибаться. Вес облицовки из стального сайдинга довольно значителен. Также из минусов материала данного типа можно назвать его подверженность коррозионным процессам.\r\n<br/><br/>\r\n3. Алюминиевый сайдинг. Имеет небольшой вес, что позволяет использовать его для облицовки обычных жилых домов. Коррозия алюминию не страшна. Но материал подвержен появлению царапин, а стоит он довольно дорого. Зато облицовка из него получается невероятно презентабельной на вид.\r\n<br/><br/>\r\nСуществуют и другие виды сайдинга, например, деревянный и цементный. Но применяются они крайне редко, поскольку обладают не такой большой функциональностью, как описанные ранее варианты.', 'сайдинг какой лучше, сайдинг какой выбрать', 'Какой лучше выбрать сайдинг для облицовки внешней стороны стен'),
(308, 'atlas_2', 'Атлас 2 (Atlas 2)', '<li><span>Стены:</span><span> 2-х слойная, блоки газобетон SOLBET 24 см + пенополистирол </span></li> \r\n<li><span>Перекрытия:</span><span> стропильные фермы </span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 30°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 0, 0, 1, 1, 1, 1, 1, 4, 1, 0, 408.46, 66.23, 550, '0000-00-00 00:00:00', '2015-04-02 11:08:18', '', '', ''),
