(349, 'zeo_nf40', 'Зео НФ40 (Zeo NF40)', '<li><span>Стены:</span><span> 2-х слойная, блоки газобетон SOLBET + пенополистирол </span></li> \r\n<li><span>Перекрытия:</span><span> железобетонное монолитное</span></li>\r\n<li><span>Крыша:</span><span> черепица</span></li> \r\n<li><span>Уклон кровли</span><span> 45°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 1, 2, 1, 1, 1, 1, 4, 1, 470, 93.9, 600, '0000-00-00 00:00:00', '2015-04-02 11:22:56', '', '', ''),
(350, 'poziomka_3_dr-t', 'Поземка 3 др-Т (Poziomka 3 dr-T)', '<li><span>Стены:</span><span> деревянный каркас</span></li>\r\n<li><span>Перекрытия:</span><span> деревянные балки</span></li> \r\n<li><span>Крыша:</span><span> металлическая черепица</span></li>\r\n<li><span>Уклон кровли </span><span> 45°</span></li>\r\n<li><b>Возможна адаптация под любые материалы с доплатой!!!</b></li>', 1, 0, 1, 2, 1, 1, 1, 1, 1, 0, 286.47, 61.1, 480, '0000-00-00 00:00:00', '2015-04-02 11:23:10', '', '', ''),
(351, 'aksamit', 'Аксамит (Aksamit)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 25°', 1, 0, 1, 1, 1, 1, 1, 4, 4, 2, 864.7, 133.3, 550, '0000-00-00 00:00:00', '2015-04-02 11:23:25', '<p><strong>Навесной вентилируемый фасад: преимущества и технология устройства.</strong><br />\r\n<br />\r\nВ настоящий момент навесные вентилируемые фасады рассматриваются в роли наиболее оптимального варианта внешней отделки зданий различного назначения. Особенно часто навесные фасады обустраиваются в отношении объектов общественного и промышленного назначения. Конструкция подобного типа обладает многими преимуществами, что и обеспечивает ей высокую востребованность.<br />\r\n<br />\r\n<strong>Преимущества вентилируемых фасадов</strong><br />\r\n<br />\r\nОгромный плюс вентилируемого фасада состоит в том, что для его обустройства не приходится предварительно подготавливать рабочую поверхность слишком серьезно. Неровности и другие дефекты, которые присутствуют на поверхности фасада постройки, будут впоследствии замаскированы элементами фасадной системы.<br />\r\n<br />\r\nЗа счет установки вентилируемых фасадов удается значительно увеличить тепло- и звукоизоляцию внутренних помещений. Как понятно по названию, фасадная конструкция подобного рода дает возможность для обеспечения качественной вентиляции поверхности стен здания. Внешний вид вентилируемого фасада очень эстетичен, но применяемые для его обустройства материалы одновременно не только делают здание более привлекательным, но еще и защищают его от внешних воздействий.<br />\r\n<br />\r\n<strong>Технология устройства вентилируемого фасада</strong><br />\r\n<br />\r\nВидимая часть вентилируемого фасада выполняется при помощи облицовочных плит, которые могут быть изготовлены из керамики или керамического гранита, искусственного или натурального камня, оцинкованной стали, алюминия и различных других исходных материалов. Панели выбранного вида закрепляются на базовом каркасе, выполняемом из алюминиевых или стальных профилей. Каркас позволяет разместить вентилируемый фасад на некотором расстоянии от поверхности стены, за счет чего и появляются разнообразные преимущества такой конструкции.<br />\r\n<br />\r\nКрепление всех используемых элементов осуществляется при помощи металлических крепежей, защищенных от коррозии и обладающих большой прочностью. Поэтому вентилируемый фасад получается очень надежным и эстетично выглядящим.<br />\r\n<br />\r\n<strong>Дополнительные возможности вентилируемого фасада</strong><br />\r\n<br />\r\nЧтобы увеличить функциональность такой фасадной конструкции, применяемые для ее создания материалы обрабатываются огнестойкими веществами. В результате навесной фасад начинает защищать здание еще и от огня. Таким образом, практичность подобного метода облицовки зданий может быть названа невероятно высокой.</p>\r\n', 'технология устройства вентилируемого фасада, вентилируемый фасад', 'Давайте рассмотрим преимущества технологии навесного вентилируемого фасада'),
(352, 'opus_2', 'Опус 2 (Opus 2)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 35° и 45°', 1, 0, 0, 1, 0, 1, 1, 1, 5, 0, 813, 201.4, 500, '0000-00-00 00:00:00', '2015-04-02 11:23:37', '', '', ''),
(353, 'cykada_2', 'Цикада 2 (Cykada 2)', 'Стены: 3-слойноя  пустотелый керамический блок + минеральноя шерсть, на мансарде деревянные, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 30 и 35°', 1, 0, 1, 1, 0, 1, 1, 10, 5, 0, 3020, 549.6, 2500, '0000-00-00 00:00:00', '2015-04-02 11:23:50', '', '', ''),
(354, 'czajka', 'Чибис (Czajka)', 'Стены: 2-слойноя  YTONG 36,5 cm + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 45°', 1, 0, 1, 2, 1, 1, 1, 1, 1, 0, 480, 105.2, 405, '0000-00-00 00:00:00', '2015-04-02 11:24:34', '', '', ''),
(355, 'as', 'Туз (As)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: гончарная черепица, угол наклонения 25°', 1, 0, 0, 2, 1, 1, 1, 4, 1, 0, 625, 125.8, 405, '0000-00-00 00:00:00', '2015-04-02 11:24:46', '', '', ''),
(356, 'aksamit_mc', 'Аксамит МС (Aksamit MC)', 'Стены: 2-слойноя  пустотелый керамический блок + минеральноя шерсть ISOVER, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 25°', 1, 0, 1, 1, 1, 1, 1, 4, 4, 2, 864.7, 133.3, 550, '0000-00-00 00:00:00', '2015-04-02 11:24:58', '<p><strong>Как выполнить монтаж пластиковых панелей в ванной.</strong><br />\r\n<br />\r\nВыбор материалов, при помощи которых можно провести отделку стен в ванной комнате, довольно велик. Кафельная плитка считается самым оптимальным вариантом, но стоит она дорого. Многие владельцы сегодня прибегают к применению пластиковых панелей, которые обладают не меньшей практичностью, но обходятся дешевле. Остается только правильно выполнить монтаж этого отделочного материала.<br />\r\n<br />\r\n<strong>Подготовка поверхности</strong><br />\r\n<br />\r\nВ связи с тем, что сами пластиковые панели способны выравнивать рабочее основание, предварительные мероприятия перед их установкой не очень сложны. Но поскольку работа проводится в ванной комнате, поверхность стен необходимо обработать антисептическими веществами. Тогда на них не появится плесень.<br />\r\n<br />\r\nОснованием для закрепления пластиковых панелей является обрешетка. Ее лучше выполнять из алюминиевых профилей, но подойдут и деревянные бруски сечением 30x30 мм. Их необходимо располагать горизонтально на таком расстоянии друг от друга, чтобы панель можно было впоследствии прихватить минимум в трех местах по всей ее длине. Закрепить элементы обрешетки к поверхности можно простыми саморезами.<br />\r\n<br />\r\n<strong>Закрепление пластиковых панелей</strong><br />\r\n<br />\r\nМонтаж пластиковых панелей к обрешетке не отличается сложностью. Провести такую работу можно довольно быстро, поскольку эти элементы обладают монтажными петлями и замками для сцепления друг с другом. Начинать монтаж пластиковых панелей необходимо с одного из углов помещения.<br />\r\n<br />\r\nПервая пластиковая панель крепится вертикально таким образом, чтобы ее паз был расположен впритык к углу комнаты. В монтажные петли продеваются саморезы, которыми панель прикрепляется к обрешетке. Следующая панель накладывается пазом на гребень предыдущей и тоже прикрепляется к основанию.<br />\r\n<br />\r\n<strong>Дополнительное декорирование облицовки</strong><br />\r\n<br />\r\nПо той причине, что после полной облицовки стены остаются неприглядные стыки в углах и на границе с полом и потолком, требуется дополнительное декорирование отделки. Его можно выполнить, если использовать специальные доборные элементы. Это уголки, которые просто приклеиваются в местах неприглядных стыков. В результате отделка будет выглядеть намного эстетичнее.<br />\r\n<br />\r\nГрамотно выполненный монтаж пластиковых панелей позволяет защитить стены в ванной комнате от негативных воздействий, а также улучшить общую привлекательность интерьера комнаты. Кроме того, много платить для достижения подобного эффекта не требуется.</p>\r\n', 'монтаж пластиковых панелей, панели в ванной', 'Выбираем материал для внутренней отделки ванной комнаты, почему пластиковые панели'),
