(451, 'vigo_2', 'Виго 2 (Vigo 2)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные', 1, 0, 0, 2, 1, 1, 1, 1, 4, 1, 505, 111.4, 530, '0000-00-00 00:00:00', '2015-04-02 16:10:11', '', '', ''),
(452, 'slowik', 'Соловей (Słowik)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 40°', 1, 0, 0, 2, 0, 1, 1, 1, 1, 0, 382, 88.1, 405, '0000-00-00 00:00:00', '2015-04-02 16:10:24', '', '', ''),
(453, 'ambrozja_mc', 'Амброзия МС (Ambrozja MC)', 'Стены: 2-слойноя  пустотелый керамический блок + минеральноя шерсть ISOVER, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 25°', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 988, 134.99, 550, '0000-00-00 00:00:00', '2015-04-02 16:10:43', '<p><strong>Отопление частного дома.</strong><br />\r\n<br />\r\nПри строительстве частного дома важно обращать свое внимание на правильное проектирование системы отопления. Существует множество различных типов систем, отопительных приборов и арматуры.<br />\r\n<br />\r\n<strong>Газовое отопление</strong><br />\r\n<br />\r\nДля обогрева частного дома лучше всего подойдет газовое отопление, с помощью котла. Магистральный природный газ &mdash; один из самых недорогих ресурсов. Кроме того, в отличие от электрической системы нет огромной проблемы из-за постоянных перепадов электроэнергии.<br />\r\n<br />\r\nК современным отопительным системам принято предъявлять ряд требований: экономичность, эффективность, надежность и компактность.<br />\r\n<br />\r\n<strong>Двухтрубная система отопления</strong><br />\r\n<br />\r\nДалее следует важное решение по затратам, которые необходимы для построения хорошей системы отопления. Идеальным вариантом станет двухтрубная система, где к каждому отопительному прибору подключается подача и обратка. Происходит хороший и равномерный прогрев всех помещений. При наличии лишних денег стоит подумать и о системах &laquo;теплый пол&raquo; в ванной комнате и на кухне. Кроме того, существуют термостатические головки для каждого отопительного прибора, которые помогут в регулировании температуры. Для совсем обеспеченных клиентов современные проектировочные фирмы предлагают системы снеготаяния для улицы, а также воздушные завесы на входные двери и в гараже.<br />\r\n<br />\r\n<strong>Бюджетный вариант однотрубной системы отопления</strong><br />\r\n<br />\r\nЕсли средств недостаточно, можно обратить свое внимание к старому, проверенному методу однотрубного отопления. В данном случае прогрев всех помещений будет разный, чем дальше прибор от котла, тем более холодный будет в нем теплоноситель. Однако в два раза меньшее количество труб &mdash; отличный вариант экономии средств.<br />\r\n<br />\r\n<strong>Другие варианты</strong><br />\r\n<br />\r\nПри отсутствии магистрального газопровода следует обратить внимание на твердотопливные котлы. Это не лучший метод отопления, так как он требует постоянных манипуляций (подбрасывание топлива в топку). Электрический котел проще установить, но его мощность несравнима с газовым и твердотопливным вариантом.<br />\r\n<br />\r\n<strong>Вывод</strong><br />\r\n<br />\r\nОднозначно стоит устанавливать газовое отопление. Несмотря на то что существует необходимость получения специального разрешения на установку, все окупается в первые 5 лет эксплуатации. Никакой электрический или твердотопливный котел никогда не сможет занять почетное место лидера, так как у них слишком много явных недостатков.</p>\r\n', 'отопление частного дома, отопление дома газовое', 'Какую схему отопления лучше выбрать для частного дома, газовую или другую'),
(454, 'decyma_2', 'Децима 2 (Decyma 2)', 'Стены: 2-слойноя  ячейковый бетон + стиропор, Крыша: гончарная черепица, угол наклонения 25°', 1, 0, 0, 3, 1, 1, 1, 4, 4, 0, 512, 97.92, 550, '0000-00-00 00:00:00', '2015-04-02 16:11:31', '<p><strong>Возведение домов из клееного бруса.</strong><br />\r\n<br />\r\nЧтобы постройка радовала хозяев долгие десятилетия, нужно для ее возведения выбрать наиболее качественные стройматериалы. Если вы остановили свой выбор на клееном брусе, то нисколько не пожалеете об этом. Ведь этот материал предназначен и для жилых домов, и для бань, хозяйственных построек. Он также подходит для строительства беседок, саун. В отличие от цельного бруса, клееный материал обладает рядом выдающихся достоинств.<br />\r\n<br />\r\nНужно сказать, что применение этого материала является рациональным решением при строительстве загородных домов. Стены из клееного бруса более устойчивы к негативным воздействиям, таким как дождь, температурные колебания, появление плесени и гнили. Сам материал имеет столь качественно обработанную поверхность, что стены не нужно дополнительно обшивать вагонкой или окрашивать, лакировать.<br />\r\n<br />\r\nПроизводится клееный брус преимущественно из хвойной древесины. Это такие прочные и надежные породы, как ель, сосна, лиственница.<br />\r\n<br />\r\nКлееный брус лишен таких недостатков цельного дерева, как склонность к усадке, деформациям в результате высыхания, поражение гнилью. Он изначально сушится на предприятиях, проходит антисептическую обработку. Для снижения пожароопасности этот материал обрабатывают антипиренами. Это актуально при строительстве современных домов, оснащенных большим количеством электрооборудования, приборов высокой мощности.<br />\r\n<br />\r\nТакже стоит отметить, что клееный брус имеет идеальную форму. Высокоточная обработка позволяет укладывать венцы без дополнительной подгонки, что значительно сокращает время сборки.<br />\r\n<br />\r\nТак как материал не дает усадки, можно приступать к монтажу окон и дверей сразу после сборки стен. Строительные работы можно завершить всего за пару месяцев, после чего дом готов к заселению.<br />\r\n<br />\r\nПостройки из клееного бруса отличаются идеально гладкой поверхностью. Так как брус может иметь длину 12 м, возможна реализация достаточно оригинального архитектурного проекта. Помещения такого дома будут более просторными, чем в постройке из простого бревна.<br />\r\n<br />\r\nСрок службы дома может составить до 100 лет, если бережно относиться к нему, своевременно бороться с сыростью, периодически восстанавливать защитное покрытие стен.</p>\r\n', 'дом из бруса, дом из клееного бруса ', 'Советы по лучшему возведению своего дома из деревянного клееного бруса'),
