(519, 'amadeusz', 'Amadeusz', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные', 1, 0, 0, 3, 0, 1, 1, 6, 3, 0, 1897, 319.3, 1500, '0000-00-00 00:00:00', '2015-03-26 14:22:30', '', '', ''),
(520, 'astron_2', 'Astron 2', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 38°', 1, 0, 0, 1, 0, 1, 1, 1, 3, 4, 2038, 403, 1500, '0000-00-00 00:00:00', '2015-03-26 14:37:17', '', '', ''),
(521, 'aksamit_4', 'Aksamit 4', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: гончарная черепица, угол наклонения 25°', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 1018, 138.5, 550, '0000-00-00 00:00:00', '2015-03-27 17:53:24', '<p><strong>Обои для кухни: характеристики и основные виды.</strong><br />\r\n<br />\r\nВыбор обоев на рынке невероятно огромен. Они различаются не только по внешнему виду, но еще и по эксплуатационным характеристикам. Когда обои выбираются для выполнения ремонта на кухне, на практические качества материала в первую очередь нужно обращать внимание. Какие обои подойдут для кухни? В этом полезно разобраться.<br />\r\n<br />\r\n<strong>Какими должны быть обои для кухни</strong><br />\r\n<br />\r\nИспользуемые на кухне обои должны обладать способностью отталкивать влагу и легко отмываться от загрязнений. Кухня отличается тем, что уровень влажности в этом помещении довольно велик. Здесь постоянно образуются внушительные объемы загрязнений, которые оседают на отделке. Выбранные обои обязаны легко справляться с этими негативными воздействиями.<br />\r\n<br />\r\nСуществует не так много материалов, соответствующих указанным требованиям. Тем не менее, некоторые их виды вполне доступны и могут быть применены владельцами жилища.<br />\r\n<br />\r\n<strong>Какие обои подойдут для кухни</strong><br />\r\n<br />\r\n1. Виниловые обои. Основой виниловых обоев может выступать лист бумаги. Но их практические качества определяются наличием тонкой пленки из ПВХ на лицевой поверхности. Эта пленка препятствует проникновению влаги, но и ухудшает пропускание обоями воздуха. Виниловые обои достаточно практичны, но использовать их нужно только в том случае, если на кухне организовано интенсивное вентилирование.<br />\r\n<br />\r\n2. Флизелиновые обои. Флизелин, на основе которого изготовлен этот материал, является разновидностью целлюлозы. Такому покрытию не страшна вода, оно легко переносит механические воздействия. Поэтому флизелиновые обои отличаются влагостойкостью и не портятся даже при частом мытье. В отличии от виниловых, флизелиновые обои воздух пропускают без проблем. Они еще и обладают интересным рельефом, позволяющим оформить интерьер кухни более презентабельно.<br />\r\n<br />\r\n3. Стекловолокнистые обои. Из всех представленных материалов именно этот лучше всего подходит для кухни. Стеклообои, как по-другому его называют, является экологически чистым, влагостойким и очень прочным отделочным покрытием. Поэтому на кухне стеклообои смогут прослужить долго и не испортятся от приходящихся на них негативных воздействий. Но и стоит этот материал дорого.<br />\r\n<br />\r\nВыбрав наиболее подходящий вариант обоев для кухни, можно добиться качественного оформления интерьера, остающегося в прекрасном состоянии долгие годы. Поэтому к покупке обоев для кухни необходимо подходить очень внимательно.</p>\r\n', 'обои для кухни, виды обоев кухни', 'Выбираем обои для кухни, полезная информация и обзор характеристик'),
(522, 'amelia_mc', 'Amelia MC', 'Стены: 2-слойноя  пустотелый керамический блок + минеральноя шерсть ISOVER, Перекрытия: железобетонные, выленные', 1, 0, 0, 2, 1, 1, 1, 1, 4, 0, 618, 137.6, 405, '0000-00-00 00:00:00', '2015-03-26 14:26:07', '', '', ''),
(523, 'ambrozja_3', 'Амброзия 3 (Ambrozja 3)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 25°', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 913.4, 158.48, 600, '0000-00-00 00:00:00', '2015-04-02 16:11:16', '<p><strong>Газобетонные и пенобетонные стеновые блоки.</strong><br />\r\n<br />\r\nГазобетон и его аналог пенобетон относятся к ячеистым бетонам - это современный стройматериал, обладающий уникальным набором технических и эксплуатационных показателей. Ячеистый бетон имеет достаточно высокую прочность, которая позволяет возводить несущие конструкции при возведении двух- и трехэтажных зданий различного назначения. Что касается газобетона, то его пористость составляет 85% - вся его структура наполнена воздушными порами и капиллярами. Такое качество роднит его с натуральной древесиной. Недаром газобетонные блоки сравнивают с деревом - они такие же легкие, экологически чистые и обладают способностью &ldquo;дышать&rdquo;.<br />\r\n<br />\r\nПенобетон и газобетон производятся по разным технологиям. Пенобетонные блоки получают из смеси портландцемента, кварцевого песка, извести с добавлением пенообразователя. Газобетон, в отличие от пенобетона, изготавливается исключительно в заводских условиях. Образование пор в газобетоне имеет химическое происхождение - при взаимодействии алюминиевой пудры со специальными добавками выделяется газ, равномерно заполняющий всю массу твердеющего бетона.<br />\r\n<br />\r\n<strong>Свойства ячеистых бетонов, являющиеся их достоинствами:</strong><br />\r\n<br />\r\n- низкая теплопроводность. Это, пожалуй, главный плюс данных материалов. Конструкции из газобетонных и пенобетонных блоков не требуют дополнительной теплоизоляции. Зимой в домах из таких стеновых материалов тепло, а летом сохраняется прохлада, поскольку стены не перегреваются;<br />\r\n<br />\r\n- наличие воздушных пузырьков обуславливает отличные шумоизоляционные качества подобных изделий;<br />\r\n<br />\r\n- небольшой вес конструкций из ячеистого бетона позволяет применять менее массивный фундамент, чем при строительстве зданий из обычного кирпича или железобетона;<br />\r\n<br />\r\n- ячеистый бетон свободно пропускает пары, образующиеся в жилых помещениях. Пар не конденсируется в толще стенового материала, а улетучивается в атмосферу. Это позволяет стенам оставаться сухими, что благоприятно сказывается на влажностном режиме в помещениях;<br />\r\n<br />\r\n- удобство обработки. Пенобетонные и газобетонные блоки легко разрезаются специальной ножовкой, сверлятся и пробиваются гвоздями. В этом отношении они близки к деревянным стройматериалам;<br />\r\n<br />\r\n- укладка блоков выполняется намного быстрее по сравнению с кирпичом. Блоки имеют крупные размеры и при этом весят немного - их можно вручную поднимать на любую высоту;<br />\r\n<br />\r\n- ячеистые бетоны являются пожаробезопасными, огнестойкими материалами.<br />\r\n<br />\r\nЗдания из ячеистого бетона рассчитаны на многолетнюю эксплуатацию. При соблюдении техники монтажа и своевременном ремонте пенобетонный дом прослужит своим хозяевам не меньше ста лет.<br />\r\n<br />\r\nПенобетон - один из наиболее экологически чистых стеновых материалов. В нем отсутствуют токсичные компоненты, материал не подвержен биологическому разложению и не выделяет вредных испарений. Кроме того, в нем отсутствует радиоактивный фон.<br />\r\n<br />\r\nПрименение блоков из ячеистого бетона при строительстве различных построек позволяет повысить скорость работ примерно в 5 раз, если сравнивать с технологией кирпичной кладки. При этом количество требуемого раствора (а точнее, клея) снижается в 7 раз.</p>\r\n', 'пенобетонные блоки, газобетонные блоки', 'Сравнение и отзывы газобетонных блоков с пенобетонными'),
