(532, 'ambrozja_nf40', 'Амброзия НФ40 (Ambrozja NF40)', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 25°', 1, 0, 0, 1, 1, 1, 1, 4, 4, 2, 852.2, 137, 550, '0000-00-00 00:00:00', '2015-04-02 16:11:06', '<p><strong>Забор из сетки-рабицы не сдает своих позиций.</strong><br />\r\n<br />\r\nНе найдется человека, который бы не знал, что такое сетка-рабица и где ее можно применить. На протяжении многих лет данный материал используют для устройства ограждений различного назначения.<br />\r\n<br />\r\n<strong>Виды и преимущества сетки-рабицы для ограждений</strong><br />\r\n<br />\r\nСетку-рабицу можно приобрести в рулонах, ширина которых 1,5- 4 метра. Размер ячеек варьируется от 20 до 100 мм при диаметре проволоки от 2 до 3 мм. В последнее время пальма первенства отдается сетке из проволоки с оцинкованным и полимерным покрытием. Такой материал более долговечен, а цвет полимера придает ограждению декоративности. Количество преимуществ сетки-рабицы перед другими материалами, даже самыми современными и модными, неоспоримо. Вот те из них, которые позволяют долгие годы удерживать лидирующие позиции на рынке:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>самая низкая стоимость для ограждающих материалов;</li>\r\n	<li>возможность перемещения в любое место;</li>\r\n	<li>простота установки и быстрота выполнения работ;</li>\r\n	<li>прозрачность для вентиляции и света;</li>\r\n	<li>способность стать опорой для живой изгороди;</li>\r\n	<li>возможность установки незаметной защиты от проникновения (размещение проволоки типа &laquo;егоза&raquo; по верхнему краю);</li>\r\n	<li>долговечность.</li>\r\n</ul>\r\n\r\n<p>&nbsp;\r\n<p><br />\r\n<strong>Виды забора из сетки и материалы для установки</strong><br />\r\n<br />\r\nЗабор из сетки-рабицы может быть натяжным и секционным. Секционный забор состоит из пролетов, где в обрамление из металлического уголка вставлена сетка-рабица. Крепится она с помощью проволоки сечением 6 или 8 мм, вставленной в крайние ячейки и приваренной к уголкам. Секционный забор, установленный на ленточный фундамент - практичное и недорогое ограждение для фасадной стороны загородного дома или дачи.<br />\r\n<br />\r\nДля установки пролетов необходимы металлические столбики из трубы или швеллера, к которым привариваются кусочки трубы длиною 6-10 см и диаметром 10-14 мм в двух или трех местах. К секциям в соответствующих местах надо добавить крючки из арматуры сечением 8-12 мм. Секция навешивается на столбики. Для фиксации на крючках можно выполнить резьбу и снизу завернуть гайку. Соединение со швеллером можно выполнить и на болтах через просверленные отверстия.<br />\r\n<br />\r\nНатяжной забор &ndash; это рулонная сетка, закрепленная на предварительно вкопанные или забетонированные опоры. Для них используются бетонные столбики для ограждений, деревянные брусы или металлические и асбестоцементные трубы. Чтобы исключить провисание сетки, в верхней и нижней части забора через ячейки между столбами необходимо протянуть стальную проволоку. К столбам, расстояние между которыми 2,5-3 м, сетка крепится хомутами или вязальной проволокой.<br />\r\n<br />\r\nОграждение из сетки-рабицы дешевое и практичное, а в вопросах престижности и эстетичности у каждого свое мнение.</p>\r\n</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'забор сетки рабицы, натяжной забор сетки', 'На что обратить внимание при покупке и натяжении забора их сетки рабицы'),
(533, 'tercja_6', 'Tercja 6', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 30 и 35°', 1, 0, 0, 3, 1, 1, 1, 4, 5, 0, 1045, 159.6, 700, '0000-00-00 00:00:00', '2015-03-27 17:58:08', '', '', ''),
(534, 'aksamit_nf40', 'Aksamit NF40', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 25°', 1, 0, 1, 1, 1, 1, 1, 4, 4, 2, 864.7, 133.3, 550, '0000-00-00 00:00:00', '2015-03-27 18:18:08', '<p><strong>Качества гипсокартона и его основные виды.</strong><br />\r\n<br />\r\nНе только профессиональные строители, но и простые владельцы жилищ сегодня прекрасно знают такой универсальный материал, как гипсокартон. Так называют листовые панели, состоящие из гипсовой прослойки и двух листов плотного картона по сторонам от него. Гипсокартонные панели отличаются прочностью и небольшим весом. Но еще больше ценится то, что он обладает широчайшей сферой применения.<br />\r\n<br />\r\n<strong>Общие особенности гипсокартонных панелей</strong><br />\r\n<br />\r\nВажно понимать, каким образом гипсокартон можно использовать в зависимости от его разновидности. Но какой бы вариант гипсокартонных панелей в конкретном случае ни использовался, он подойдет для создания межкомнатных перегородок, обшивки стен или потолка. Гипсокартон способен выступать в роли материала для вставок в натяжных потолках, применяется при монтаже подвесных потолков. Использовать гипсокартон можно и в том случае, если необходимо получить встроенный шкаф.<br />\r\n<br />\r\nНо все-таки необходимо точно представлять, какими отличительными особенностями обладает каждый из существующих типов гипсокартона. Они различаются не только по практическим характеристикам, но и по области применения.<br />\r\n<br />\r\n<strong>Основные виды гипсокартона и их применение</strong><br />\r\n<br />\r\n1. Простой гипсокартон (ГКЛ). Такой гипсокартонный лист выполняется в сером цвете и подходит для проведения отделочных работ в помещениях, для которых характерен обычный уровень влажности. Толщина листов этого материала составляет 8-16 мм. Этот вид гипсокартона подходит при выполнении обшивки стен, создании межкомнатных перегородок. Но воздействие влаги или огня способно его испортить.<br />\r\n<br />\r\n2. Влагостойкий гипсокартон (ГКЛВ). Отличается зеленой окраской, но обладает той же шириной, что и предыдущий вариант. Его можно использовать в процессе обшивки стен в таких помещениях, как кухня или ванна. Поверхность влагостойкого гипсокартона не покроется плесенью, а сам он не покоробится от влаги.<br />\r\n<br />\r\n3. Огнестойкий гипсокартон (ГКЛО). Применяется при работе в помещениях, где присутствует источник открытого пламени. Огнестойкий гипсокартон способен к самозатуханию, поэтому он уместен в процессе ремонта в котельных.<br />\r\n<br />\r\nСуществуют и менее распространенные варианты гипсокартонных листов, которые предназначены для выполнения комплексной звукоизоляции поверхностей или создания декоративных конструкций в помещении. Если тип материала грамотно выбран, то проблем с его монтажом и эксплуатацией не возникнет.</p>\r\n', 'качества гипсокартона, виды гипсокартона', 'Какие качества преобладают у гипсокартона в зависимости от его вида'),
