(573, 'agawa_2', 'Agawa 2', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 43°', 1, 0, 1, 2, 1, 1, 1, 1, 1, 1, 803, 116.9, 550, '0000-00-00 00:00:00', '2015-03-26 14:09:56', '', '', ''),
(574, 'aksamit_2', 'Aksamit 2', 'Стены: 2-слойноя  пустотелый керамический блок + стиропор, Перекрытия: железобетонные, выленные, Крыша: черепица, угол наклонения 30°', 1, 0, 1, 1, 1, 1, 1, 1, 4, 2, 1130.28, 214.87, 550, '0000-00-00 00:00:00', '2015-03-26 14:12:01', '<p><strong>Как покрыть стены фактурной штукатуркой.</strong><br />\r\n<br />\r\nПридать стенам жилого помещения особенно презентабельный вид, не прибегая к помощи специалистов, можно при помощи фактурной штукатурки. В том случае, если к процедуре ее нанесения владелец подошел ответственно, он способен добиться серьезного преображения рабочей поверхности. Самое главное &ndash; правильно соблюдать последовательность работы с этим отделочным материалом.<br />\r\n<br />\r\n<strong>1. Подготовка поверхности</strong><br />\r\n<br />\r\nСтены необходимо очистить от тех отделочных материалов, которые раньше были применены для их оформления. Обои получится быстро устранить, если предварительно промочить их водой. Старая краска очищается металлическим шпателем. После этого оставшиеся неровности устраняются штукатурной смесью или шпатлевкой.<br />\r\n<br />\r\nЕсли на поверхности присутствуют какие-либо металлические элементы, то их необходимо изолировать, чтобы впоследствии не возникла ржавчина. Сделать это можно, если покрыть металл водно-дисперсионной краской или просто заклеить монтажной лентой.<br />\r\n<br />\r\n<strong>2. Нанесение фактурной штукатурки</strong><br />\r\n<br />\r\nНаносить материал на поверхность можно при помощи шпателя или валика. Штукатурку необходимо разбавлять небольшим количеством воды. Достаточно примерно 0,5 л жидкости, чтобы привести в рабочее состояние 20 кг сухой смеси фактурной штукатурки. При нанесении расход должен составлять около 1 кг готового материала на 1 м2 поверхности. Если на стене остались какие-либо неровности, то расход может увеличиться вдвое. Это необходимо учитывать при приобретении и подготовке смеси.<br />\r\n<br />\r\nЧтобы нанести фактурную штукатурку, много сил не требуется. Технология в данном случае такая же, как при обращении с обычной штукатуркой. Основная работа проводится после того, как штукатурная масса будет нанесена. Чтобы придать рельеф отделке, по ней необходимо пройтись фактурным валиком. На его поверхности имеется определенный узор, который затем переносится на штукатурку.<br />\r\n<br />\r\n<strong>3. Финишные работы</strong><br />\r\n<br />\r\nКогда поверхность будет полностью покрыта штукатуркой, потребуется провести дополнительное ее ошкуривание. Сделать это можно наждачной шкуркой, чтобы в итоге не оставалось эстетических дефектов. Также наждачная шкурка позволяет придать отделке более гладкий и отполированный вид.<br />\r\n<br />\r\nЕсли технология работы полностью соблюдена, результат отделочных мероприятий обязательно порадует. Фактурная штукатурка будет долго служить и сможет превосходно украсить интерьер любого жилого помещения.</p>\r\n', 'фактурная штукатурка, как покрыть фактурной штукатуркой', 'Придаем стенам здания декоративный вид при помощи фактурной штукатурки'),
